import React from "react";
import Card from "./Card";

class CardsFetch extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        const cards = this.state.items
			.map((item) => {
				return <Card key={item.id} item={item} />;
			});
        return(
                <div id="cards" className="row">
					{cards}
				</div>

        );
    }
}
export default CardsFetch;
